import React, { Component } from 'react';
import '../styles/App.css';

import logo from '../BrainFlix-Sprint-1/4.0 - Assets/Logo/Logo-brainflix.png';
import profilePicture from '../BrainFlix-Sprint-1/4.0 - Assets/Images/Mohan-muruge.jpg';
import Button from '@material-ui/core/Button';

class Nav extends Component {
    render() {
        return (
            <div className="Nav">
                <img className="Nav__logo" src={logo} alt="logo" />
                <div className="Navlinks">
                    <input type="text" className="Nav__search" placeholder="Search"></input>
                    <Button className="Nav__button" variant="contained">UPLOAD</Button>
                    <img className="Nav__profile" src={profilePicture} alt="profilePicture" />
                </div>
            </div>
        )
    }
}

export default Nav
